<style>
* {margin:0;padding:0;box-sizing:border-box}
body {font-family:Georgia,serif;background:linear-gradient(135deg,#F4EFE8 0%,#E6D9C6 100%);min-height:100vh;padding:2rem 1.5rem}
.container {max-width:800px;margin:0 auto}
.header {text-align:center;margin-bottom:3rem}
.header h1 {font-size:2.5rem;color:#0F4C4F;margin-bottom:1rem;font-weight:400}
.header p {font-size:1.125rem;color:#6B4A2F;line-height:1.6;margin-bottom:2rem}
.header img {max-width:400px;width:100%;height:auto;border-radius:12px;box-shadow:0 8px 24px rgba(15,76,79,0.15);display:block;margin:0 auto 2rem auto}
.progress-bar {background:white;border-radius:12px;padding:1rem;margin-bottom:2rem;box-shadow:0 4px 12px rgba(15,76,79,0.1)}
.progress-info {display:flex;justify-content:space-between;margin-bottom:0.5rem;font-size:0.875rem;color:#6B4A2F}
.progress-track {width:100%;height:8px;background:#E6D9C6;border-radius:4px;overflow:hidden}
.progress-fill {height:100%;background:linear-gradient(90deg,#C9A44C,#E3C36A);transition:width 0.3s ease}
.question-card {background:white;border-radius:16px;padding:2.5rem;box-shadow:0 8px 24px rgba(15,76,79,0.1);margin-bottom:2rem}
.question-title {font-size:1.5rem;color:#0F4C4F;margin-bottom:2rem;line-height:1.6}
.options {display:flex;flex-direction:column;gap:1rem}
.option {padding:1.25rem;border:2px solid #E6D9C6;border-radius:12px;cursor:pointer;transition:all 0.3s;background:white;display:flex;align-items:center;gap:1rem}
.option:hover {border-color:#C9A44C;background:#FFFBF5}
.option.selected {border-color:#C9A44C;background:#FFF9F0}
.option-radio,.option-checkbox {width:24px;height:24px;border:2px solid #D8C5AE;background:white;flex-shrink:0;display:flex;align-items:center;justify-content:center}
.option-radio {border-radius:50%}
.option-checkbox {border-radius:6px}
.option.selected .option-radio,.option.selected .option-checkbox {border-color:#C9A44C;background:#C9A44C}
.option.selected .option-radio::after {content:'';width:10px;height:10px;border-radius:50%;background:white}
.option.selected .option-checkbox::after {content:'âœ“';color:white;font-size:0.875rem}
.option-label {font-size:1rem;color:#3E2A1E;line-height:1.5}
textarea {width:100%;margin-top:1rem;padding:1rem;border:2px solid #E6D9C6;border-radius:12px;font-size:1rem;font-family:Georgia,serif;resize:vertical;min-height:100px}
.navigation {display:flex;gap:1rem;justify-content:space-between}
button {padding:1rem 2rem;border:none;border-radius:12px;font-size:1.125rem;cursor:pointer;transition:all 0.3s;font-family:Georgia,serif}
.btn-prev {background:white;color:#0F4C4F;border:2px solid #E6D9C6}
.btn-prev:hover:not(:disabled) {background:#F4EFE8}
.btn-prev:disabled {background:#E6D9C6;color:#A8893E;cursor:not-allowed}
.btn-next {background:#0F4C4F;color:white;flex:1}
.btn-next:hover:not(:disabled) {background:#2F6F73}
.btn-next:disabled {background:#D8C5AE;cursor:not-allowed}
.result-card {background:white;border-radius:16px;padding:3rem;box-shadow:0 10px 40px rgba(15,76,79,0.15);text-align:center}
.result-image {max-width:300px;width:100%;height:auto;border-radius:12px;margin:0 auto 1.5rem;box-shadow:0 8px 24px rgba(15,76,79,0.15);display:block}
.result-title {font-size:2rem;color:#0F4C4F;margin-bottom:1rem;font-weight:400}
.result-description {font-size:1.125rem;line-height:1.8;color:#3E2A1E;margin-bottom:2rem}
.validation-form {background:#FFF9F0;padding:2rem;border:2px solid #E3C36A;border-radius:12px;margin-bottom:2rem}
.validation-form h3 {font-size:1.25rem;color:#0F4C4F;margin-bottom:1.5rem;font-weight:400}
.form-group {margin-bottom:1rem}
.form-group label {display:block;margin-bottom:0.5rem;font-size:0.875rem;color:#6B4A2F}
.form-group input,.form-group textarea {width:100%;padding:0.875rem;border:2px solid #E6D9C6;border-radius:8px;font-size:1rem;font-family:Georgia,serif}
.btn-submit {width:100%;background:#0F4C4F;color:white;padding:1rem;border:none;border-radius:12px;font-size:1.125rem;cursor:pointer;font-family:Georgia,serif}
.btn-submit:hover {background:#2F6F73}

.btn-restart:hover {background:#F4EFE8}

  let txtField='';
  if(q.id==='q5bis'&&ans.q5bis==='Oui'){
    txtField=`<textarea placeholder="PrÃ©cisez les compÃ©tences..." oninput="competencesTxt=event.target.value">${competencesTxt}</textarea>`;
  }
  if(q.id==='q9'&&ans.q9&&ans.q9.includes("Je ne me reconnais pas dans ces situations, mon besoin c'est plutÃ´t...")){
    txtField=`<textarea placeholder="DÃ©crivez votre besoin..." oninput="otherTxt=event.target.value">${otherTxt}</textarea>`;
  }
  if(q.id==='q10'&&ans.q10==='Autre (prÃ©cisez ci-dessous)'){
    txtField=`<textarea placeholder="PrÃ©cisez vos horaires..." oninput="q10OtherText=event.target.value">${q10OtherText}</textarea>`;
  }
  
  return `
    <div class="header">
      <h1>Rose des vents</h1>
      <p>Trouvez l'accompagnement qui vous correspond</p>
      <img src="${rose}" alt="Rose des vents">
    </div>
    <div class="progress-bar">
      <div class="progress-info">
        <span>Question ${currentStepDisplay} sur ${totalSteps}</span>
        <span>${progress}%</span>
      </div>
      <div class="progress-track">
        <div class="progress-fill" style="width:${progress}%"></div>
      </div>
    </div>
    <div class="question-card">
      <h2 class="question-title">${q.text}</h2>
      <div class="options">${opts}</div>
      ${txtField}
    </div>
    <div class="navigation">
      <button class="btn-prev" onclick="handlePrev()" ${step===0?'disabled':''}>â† PrÃ©cÃ©dent</button>
      <button class="btn-next" onclick="handleNext()" ${!isAnswered(q)?'disabled':''}>
        ${isLastQuestion()?'Voir le rÃ©sultat':'Suivant â†’'}
      </button>
    </div>
  `;
}

function isLastQuestion(){
  if(step<mainQs.length){
    // Pas encore Ã  la fin des questions principales
    return false;
  }else{
    // Dans les questions profil C
    const profilCIndex=step-mainQs.length;
    return profilCIndex===profilCQs.length-1;
  }
}

function renderResult(){
  const result=getResult();
  const img=imgs[result.profile.charAt(0)];
  
  return `
    <div class="result-card">
      <img src="${img}" alt="${result.title}" class="result-image">
      <h2 class="result-title">${result.title}</h2>
      <p class="result-description">${result.description}</p>
      <div class="validation-form">
        <h3>Recevoir un entretien dÃ©couverte</h3>
        <div class="form-group">
          <label>Email * (obligatoire)</label>
          <input type="email" id="email" required>
        </div>
        <div class="form-group">
          <label>Nom et prÃ©nom (optionnel)</label>
          <input type="text" id="name">
        </div>
        <div class="form-group">
          <label>Un message Ã  ajouter ? (optionnel)</label>
          <textarea id="comment"></textarea>
        </div>
        <button class="btn-submit" onclick="handleSubmit()">Valider et recevoir mon invitation</button>
      </div>
      <button class="btn-restart" onclick="restart()">Recommencer</button>
    </div>
  `;
}

function selectSingle(qId,idx){
  const allQuestions=[...mainQs,...profilCQs];
  const q=allQuestions.find(x=>x.id===qId);
  const o=q.options[idx];
  
  // Gestion RH
  if(q.isRHQuestion&&o.isRH)isRH=true;
  
  // Gestion Profil E - on enregistre juste la rÃ©ponse
  // Le rÃ©sultat sera affichÃ© quand l'utilisateur clique sur "Suivant"
  ans[qId]=o.label;
  
  // Calcul points
  if(o.points&&!q.isDataCollection){
    Object.keys(o.points).forEach(p=>sc[p]+=o.points[p]);
  }
  
  render();
}

function selectGateway(qId,idx){
  const q=profilCQs.find(x=>x.id===qId);
  const o=q.options[idx];
  
  ans[qId]=o.label;
  
  if(o.action==='stop'||o.action==='validate'){
    showRes=true;
  }
  // Si 'continue', on continue normalement
  
  render();
}

function selectMultiple(qId,idx){
  const q=mainQs.find(x=>x.id===qId);
  const o=q.options[idx];
  
  if(!ans[qId])ans[qId]=[];
  
  const i=ans[qId].indexOf(o.label);
  if(i>-1){
    ans[qId].splice(i,1);
    if(o.points)Object.keys(o.points).forEach(p=>sc[p]-=o.points[p]);
  }else{
    ans[qId].push(o.label);
    if(o.points)Object.keys(o.points).forEach(p=>sc[p]+=o.points[p]);
  }
  
  render();
}

function isAnswered(q){
  if(q.type==='single'||q.type==='gateway')return!!ans[q.id];
  if(q.type==='multiple')return ans[q.id]&&ans[q.id].length>0;
  if(q.type==='text')return true;
  return false;
}

function handlePrev(){
  if(step>0){step--;render();}
}

function handleNext(){
  // Si l'utilisateur a rÃ©pondu "CuriositÃ©" Ã  Q7, on affiche le rÃ©sultat
  if(ans.q7==="Rien de tout Ã§a, je suis plutÃ´t lÃ  par curiositÃ©"){
    showRes=true;
    render();
    return;
  }
  
  // Si on vient de finir les questions principales (step === 10, qui est mainQs.length-1)
  if(step===mainQs.length-1){
    const tempResult=getResult();
    // Si profil C, on continue avec les questions profil C
    if(tempResult.profile==='C'){
      step++;  // On passe Ã  la premiÃ¨re question profil C
      render();
      return;
    }else{
      // Sinon, on affiche le rÃ©sultat
      showRes=true;
      render();
      return;
    }
  }
  
  // Si on est dans les questions profil C et c'est la derniÃ¨re
  if(step>=mainQs.length){
    const profilCIndex=step-mainQs.length;
    if(profilCIndex===profilCQs.length-1){
      // DerniÃ¨re question profil C
      showRes=true;
      render();
      return;
    }
  }
  
  // Sinon, question suivante
  step++;
  render();
}

function handleProfilCText(qId,e){
  if(qId==='q11_c')profilCText1=e.target.value;
  if(qId==='q12_c')profilCText2=e.target.value;
}

function getResult(){
  if(ans.q7==="Rien de tout Ã§a, je suis plutÃ´t lÃ  par curiositÃ©"){
    return{
      profile:'E',
      title:'Profil Curieux',
      description:'Vous semblez Ãªtre un profil curieux, qui aime dÃ©couvrir de nouveaux horizons. Nous vous proposons un entretien en visio pour voir si nous pouvons rÃ©pondre Ã  vos attentes.'
    };
  }
  
  if(isRH){
    return{
      profile:'D',
      title:'Foyer des RH',
      description:"Si vous Ãªtes arrivÃ©Â·e jusqu'ici, nous vous conseillons de visiter le Foyer des RH. Vous semblez Ãªtre unÂ·e professionnelÂ·le des ressources humaines qui s'adapte beaucoup, parfois au dÃ©triment de soi-mÃªme."
    };
  }
  
  const sorted=Object.entries(sc)
    .filter(([p])=>p!=='D')
    .sort(([,a],[,b])=>b-a);
  
  const [top]=sorted[0];
  
  const profiles={
    A:{title:'La Porte du Monde',description:"Votre situation semble rÃ©vÃ©ler un besoin d'action, une approche par les compÃ©tences, et des mesures concrÃ¨tes pour changer votre situation professionnelle."},
    B:{title:'La Porte du Soi',description:"Vous semblez avoir besoin d'un temps d'introspection et de recentrage, pour mieux vous dÃ©couvrir, retrouver vos ressources et votre Ã©nergie."},
    C:{title:'La Porte du MystÃ¨re',description:"Vous n'Ãªtes pas ici par hasard. Vous croyez en quelque chose de plus grand, et vous aimeriez pouvoir explorer cette partie cachÃ©e en vous."}
  };
  
  return{profile:top,...profiles[top]};
}

async function handleSubmit(){
  const email=document.getElementById('email').value;
  const name=document.getElementById('name').value;
  const comment=document.getElementById('comment').value;
  
  if(!email){
    alert('Merci de renseigner votre email');
    return;
  }
  
  const result=getResult();
  const data={
    timestamp:new Date().toISOString(),
    email,name,comment,
    profile:result.profile,
    scores:sc,
    answers:ans,
    competencesText:competencesTxt,
    otherText:otherTxt,
    profilCText1,
    profilCText2,
    q10OtherText
  };
  
  try{
    const response=await fetch(WEBHOOK,{
      method:'POST',
      headers:{'Content-Type':'application/json'},
      body:JSON.stringify(data)
    });
    
    if(response.ok){
      alert('Merci ! Nous avons bien reÃ§u vos informations.');
    }else{
      alert("Erreur lors de l'envoi. Veuillez rÃ©essayer.");
    }
  }catch(error){
    console.error('Erreur:',error);
    alert("Erreur lors de l'envoi. Veuillez rÃ©essayer.");
  }
}

function restart(){
  step=0;
  ans={};
  sc={A:0,B:0,C:0,D:0};
  showRes=false;
  isRH=false;
  otherTxt='';
  competencesTxt='';
  profilCText1='';
  profilCText2='';
  q10OtherText='';
  render();
}

render();
</script>
